import React from 'react';
import './header.css';
import CTA from './CTA';
import ME from '../../assets/headshot_no-bg.png';
import HeaderSocial from './HeaderSocials';
import Typewriter from 'typewriter-effect';

const header = () => {
  return (
    <header>
      <div className="container header_container">
        <h1>
          <Typewriter
            onInit={(typewriter) => {
              typewriter
              .changeDelay(125)
              .pauseFor(1000)
              .typeString("Hey!")
              .pauseFor(1500)
              .deleteAll()
              .typeString("I'm Rohan Srivastava!")
              .callFunction(function(state) {
                state.elements.cursor.style.color = 'transparent';
              })
              .start()
            }}
          />
        </h1>
        <h5 className='text-light'>
          <Typewriter 
              options={{cursor:''}}
              onInit={(typewriter) => {
                typewriter
                .pauseFor(7000)
                .changeCursor('|')
                .changeDelay(75)
                .typeString("Rising Senior @ Georgia Tech")
                .callFunction(function(state) {
                  state.elements.cursor.style.color = 'transparent';
                })
                .start()
              }}
          />
        </h5>
        <h5 className='text-light'>
          <Typewriter 
              options={{cursor:''}}
              onInit={(typewriter) => {
                typewriter
                .pauseFor(12000)
                .changeCursor('|')
                .changeDelay(75)
                .typeString("Currently recruiting for full time software engineering roles that start in May 2023.")
                .pauseFor(4900)
                .callFunction(function(state) {
                  state.elements.cursor.style.color = 'transparent';
                })
                .start()
              }}
          />
        </h5>

        <CTA />
        <HeaderSocial />
        <div className="me">
          <img src={ME} alt="me" />
        </div>

        <a href='#contact' className='scroll_down'>Scroll Down</a>
      </div>
    </header>
  )
}

export default header
